import React from 'react';
import NewsItem from './news_list_item'

// access the props from index.js
const NewsList = (props) => {


    console.log(props.news.items);


    // return <p>News List</p>


    if (props.new.items) {
        const items = props.news.items.map( (item) => {
            return(
              // reference the NewsList item
              <NewsItem key={item.id} item={item} />
            )
        })

        return (
          <div>
            {props.children}   {/* gets what's between the component's tags! */}
            {items}
          </div>
        )
    }


}

export default NewsList;
